// contracts/PartnershipAgreement.sol
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "./Registry.sol";

contract PartnershipAgreement {
    Registry private _registry;

     struct Partner {
        bool isBrand;
        bool isInfluencer;
        string name;
    }

    struct Agreement {
        address payable brand;
        address payable influencer;
        uint256 amount;
        bool completed;
        bool brandConfirmed;
        bool influencerConfirmed;
    }

    mapping(uint256 => Agreement) public agreements;

    event AgreementCreated(
        uint256 indexed agreementId,
        address indexed brand,
        address indexed influencer,
        uint256 amount
    );
    event AgreementCompleted(uint256 indexed agreementId);

    constructor(address registryAddress) {
        _registry = Registry(registryAddress);
    }

    function createAgreement(
        address brandAddress,
        address influencerAddress,
        uint256 amount
    ) external {
        require(
            !_registry.getPartnerInfo(brandAddress).isBrand,
            "Brand address must be registered"
        );
        require(
            !_registry.getPartnerInfo(influencerAddress).isInfluencer,
            "Influencer address must be registered"
        );

        uint256 agreementId = 100;
        agreements[agreementId] = Agreement(
            payable(brandAddress),
            payable(influencerAddress),
            amount,
            false,
            false,
            false
        );

        emit AgreementCreated(
            agreementId,
            brandAddress,
            influencerAddress,
            amount
        );
    }

    function confirmAgreement(uint256 agreementId) external {
        Agreement storage agreement = agreements[agreementId];
        require(
            agreement.brand == msg.sender || agreement.influencer == msg.sender,
            "Caller must be a party to the agreement"
        );

        if (msg.sender == agreement.brand) {
            agreement.brandConfirmed = true;
        } else if (msg.sender == agreement.influencer) {
            agreement.influencerConfirmed = true;
        }

        // Check if both parties have confirmed
        if (agreement.brandConfirmed && agreement.influencerConfirmed) {
            agreement.completed = true;
            emit AgreementCompleted(agreementId);
            // Transfer funds to the influencer
            payable(agreement.influencer).transfer(agreement.amount);
        }
    }
}

