// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.20;

// Uncomment this line to use console.log
// import "hardhat/console.sol";

import "@openzeppelin/contracts/access/Ownable.sol";

contract Registry {
    struct Partner {
        bool isBrand;
        bool isInfluencer;
        string name;
    }

    mapping(address => Partner) public partners;

    event PartnerAdded(
        address indexed partner,
        bool isBrand,
        bool isInfluencer
    );

    function addPartner(
        string memory name,
        bool isBrand,
        bool isInfluencer
    ) external {
        require(
            !partners[msg.sender].isBrand || !partners[msg.sender].isInfluencer,
            "Partner already exists"
        );
        partners[msg.sender] = Partner(isBrand, isInfluencer, name);
        emit PartnerAdded(msg.sender, isBrand, isInfluencer);
    }

    function getPartnerInfo(
        address partner
    )
        public
        view
        returns (Partner memory p)
    {
         p = partners[partner];
    }
}

